import React from 'react';

const TeamList = (props) => {
  const teamStudentsCards = [...props.teamStudents].map(student=><Card handleToggle={props.handleToggle} studentData={student} key={student._id} />)

  return (
    <div id="team-list">
      <h2>My Wizarding Team</h2>
        {teamStudentsCards}
    </div>
  )
}

export default TeamList;
